INSERT INTO dap_system_category (id, create_by, create_time, update_by, update_time, bm_status, code, code_name, full_name, parent_id, remark, topic, sub_level) VALUES ('1290914974815305729', 'createRole', '2020-08-05 15:38:08', 'admin', '2020-08-05 15:38:08', 1, 'su', '备货', '', '1290912253324374017', '以满足销售计划的备货行为为分析对象，主要包括各个平台、店铺、品类、产品等维度的备货量、备货金额、备货完成率、备货误差率等核心指标，通过监控核心指标，分析备货情况。', 0, 1);
INSERT INTO dap_system_category (id, create_by, create_time, update_by, update_time, bm_status, code, code_name, full_name, parent_id, remark, topic, sub_level) VALUES ('1290916491119153154', 'createRole', '2020-08-05 15:44:10', '80560490', '2021-09-30 17:04:33', 1, 'oper', '运营', '', '1290912253324374017', '以销售过程中的运营情况为分析对象，主要包括各个平台、店铺、品类、产品、订单等维度的销售额、销量、折扣率等核心指标，通过监控核心指标，分析销售情况', 0, 1);
