INSERT INTO dap_system_category (id, create_by, create_time, update_by, update_time, bm_status, code, code_name, full_name, parent_id, remark, topic, sub_level) VALUES ('1290918859997865428', 'createRole', '2020-08-05 16:15:21', 'admin', '2020-08-05 16:15:30', 1, 'trff', '流量', null, '1290919791038140417', '以整个市场大盘为分析对象，包含但不限于阿里、京东、苏宁和拼多多平台的类目、品牌、店铺、商品等维度的各流量渠道的流量、转化、价值等情况。如竞争店铺流量来源、竞争商品流量来源，也可包含竞争对手的内容、广告相关的数据。
INSERT INTO dap_system_category (id, create_by, create_time, update_by, update_time, bm_status, code, code_name, full_name, parent_id, remark, topic, sub_level) VALUES ('1290918859999100929', 'createRole', '2020-08-05 15:53:34', 'admin', '2020-08-05 15:53:34', 1, 'pr', '推广', 'promotion', null, '以运营人员在推广商品和消费者寻找商品过程中产生的行为及交互为分析对象。主要包含推广目标、推广计划、组织的活动、费用、内容(直播、视频、文章)等，以及用户寻找商品过程中产生的行为数据(如：互动、效果数据)等。这里的商品特指公司的产品。', 1, 0);
INSERT INTO dap_system_category (id, create_by, create_time, update_by, update_time, bm_status, code, code_name, full_name, parent_id, remark, topic, sub_level) VALUES ('1290919791038140417', 'createRole', '2020-08-05 15:57:16', 'admin', '2020-08-05 15:57:16', 1, 'mr', '市场', 'marketing', null, '以行业销售、流量相关数据为分析对象，更多关注的是竞品情况。行业包括但不限于阿里、京东、苏宁和拼多多；分析范围包括但不限于行业类目、店铺、品牌、商品等。通过分析及监控及时发现销售机会，提高业绩。', 1, 0);
INSERT INTO dap_system_category (id, create_by, create_time, update_by, update_time, bm_status, code, code_name, full_name, parent_id, remark, topic, sub_level) VALUES ('1290919791995682134', 'createRole', '2020-08-05 16:17:53', 'admin', '2020-08-05 16:18:01', 1, 'actv', '活动', null, '1290919791038140417', '以整个市场大盘中的品类、品牌、店铺、商品的活动为分析对象，主要用于分析品类、(竞争)品牌、(竞争)店铺和(竞争)商品活动的开展情况和活动的效果，如阿里聚划算竞争对手开展的活动数据。', 0, 1);
